    description: 'Ao Senhor Assistente do Exmo. Senhor Comandante-Geral da PMPR.\n\tTrata-se de requerimento de Promoção por Ato de Bravura do Sd. QPM 1-0 Osório Pereira Filho, lotado no 3BPM.\n\t2. Considerando o conteúdo do Requerimento de 25 maio 20, mov. 2, na qual o requerente encaminha documentos solicitando apreciação de pedido de Promoção Por Ato de Bravura, bem como informa que os fatos resultantes da ação desenvolvida já foram apurados por meio de Inquérito Policial Militar (IPM) nº 962/2018 SISCOGER, conforme cópia anexo no protocolo em referência.\n\t3. Considerando ainda o conteúdo do Despacho nº. 1009/2020 – COGER, mov. 7, restituo a Vossa Senhoria o presente protocolo, com vistas à Comissão de Promoção de Praças, solicitando a possibilidade de REANÁLISE no sentido verificar a real necessidade de instauração de novo procedimento administrativo, assim como de verificar se o sobredito inquérito policial militar reúne os quesitos plausíveis para apreciação do requerimento de Ato de Bravura, respeitando os princípios da celeridade e economia processual.\n\t4. Ademais, se depois da análise, a mencionada comissão entender que a apuração em tela reúne os quesitos necessários para apreciação do pedido, solicito que o presente protocolo seja restituído a esta Corregedoria para que os autos do referido inquérito policial militar sejam CONVALIDADOS através de ato do Exmo. Senhor Comandante-Geral.',
